import React from 'react'
import { useState } from 'react'
const render = ReactDOM;
import { NavLink } from 'react-router-dom'
import { ReactComponent as Hamburger } from '../../assets/hamburguerIcon.svg'
import './navbar.css'

const Navbar = () => {
  const [showNavbar, setShowNavbar] = useState(false)

  const handleShowNavbar = () => {
    setShowNavbar(!showNavbar)
  }

    // Estado para controlar la visibilidad del popup
    const [isPopupOpen, setPopupOpen] = useState(false);

    // Función para abrir el popup
    const openPopup = () => {
      setPopupOpen(true);
    };

    // Función para cerrar el popup
    const closePopup = () => {
      setPopupOpen(false);
    };

  return (
    <nav className="navbar">
      <div className="container">
        <div className="logo">
          LOGO
        </div>
        <div className="menu-icon" onClick={handleShowNavbar}>
          <Hamburger />
        </div>
        <div className={`nav-elements  ${showNavbar && 'active'}`}>
          <ul>
            <li>
              <NavLink to="/">Inicio</NavLink>
            </li>
            <li>
              <NavLink to="/agregar">Agregar</NavLink>
            </li>
            <li>
              <NavLink to="/buscar">Buscar</NavLink>
            </li>
            <li>
              <NavLink to="/stats">Stats</NavLink>
            </li>
            <li>
              <a href='#acerca'>Acerca</a> 
            </li>
            <li>
              <button onClick={openPopup} id='iniciarBtn'>Iniciar sesión</button>
            </li>
            <li>
              <button onClick={openPopup} id='registrarBtn'>Registrarme</button>
            </li>
          </ul>
          {isPopupOpen && (
        <div className="ventana-popup">
          <div className="contenido-popup">
            <p>Contenido del popup</p>
            <p><img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/47/React.svg/250px-React.svg.png" /></p>
            {/* Botón para cerrar el popup */}
            <button onClick={closePopup}>Cerrar</button>
          </div>
        </div>
      )}
        </div>
      </div>
    </nav>
  )
}
render(<PopupExample />, document.getElementById('contenedor-popup'));
export default Navbar;
